function Display() {
  
  //Get Method
  const apiGet = () => {
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => response.json())
      .then((json) => {
        console.log(json);
       
      });
  };

  return (
    <div>
      My API <br />
      <button onClick={apiGet}>Fetch API</button>
      <br />
    </div>
  );
}
